import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let dialogsData=[{name: 'Almaz', id: 1},{name: 'Alexey', id: 2},{name: 'Vika', id: 3},{name: 'Tanya', id: 4}]

let messagesData=[{id:1, message: 'Привет, как дела?'},{id:2,message: 'Привет, все хорошо, как твои?'}]

ReactDOM.render(<App dialogsData={dialogsData} messagesData={messagesData} />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
